const ideasGrid = document.getElementById('ideasGrid');

// Function to display recipe ideas
function displayRecipeIdeas(ideas) {
    ideasGrid.innerHTML = '';
    ideas.forEach(idea => {
        const card = document.createElement('div');
        card.className = 'idea-card';
        card.innerHTML = `
            <img src="${idea.image}" alt="${idea.title}">
            <h2>${idea.title}</h2>
            <p>${idea.description}</p>
        `;
        ideasGrid.appendChild(card);
    });
}

// Initial display of all recipe ideas
displayRecipeIdeas(recipeIdeas);
